For years i've stayed unspoken. The mold that once held this weak girl has broken free.&nbsp; Everyone in my life thought i've just been getting along with being happy. Or have they not seen the real me? At forteen my time has come. My hands are cold, my heart is warming up to this moment. Its hard for me to wake up each day, when you don't know your purpose.&nbsp; When you are mistaken for the complete opposite of who you are.&nbsp; As I cast my fears aside you're the only thing i feel i can't control.....; Maybe i'm just blind to your ways of love. Or maybe theres no love at all?! Ex's and Oh's mark my hands with the hope i will susceed.&nbsp;

-wrote by me.&nbsp;
